description:
Labai lengvas, plonas ir mažai naudotas nešiojamas kompiuteris:

* liečiamas ekranas;
* sveria apie 1 KG;
* 256 SSD kietasis diskas;
* 16 GB ram;
* Intel i5-8350U 8 branduolių
* 14" LED Full HD 1920x1080 "matinis" ekranas
* SD ir SIM kortelių skaitytuvas

Parduodamas geras specifikacijas turintis nešiojamas kompiuteris, su kuriuo galima dirbti įvairius darbus - Lenovo ThinkPad L15 su dar galiojancia gamintojo garantija. 

Kompiuteris vizualiai turi pabraizymu kompiuterio virsuje (matosi nuotraukoje), apart to - tiek palmrest, tiek ekranas, tiek kompiuterio apacia - geros bukles. 

Gamintojo garantija galioja iki 2025 metu. 4 menesio. 

Baterija laiko labai gerai, nusidevejimas minimalus - vos keli procentai, (nuotrauka), procesorius dirba sklandziai ir greitai.

Techininiai duomenys: 

Procesorius: Ryzen 3 Pro 5475u iki 4,1Ghz; 
Grafika: Radeon Graphics;
Ekranas: 15,6 inch. Full HD IPS matrica, matinis ekranas, spalvos labai naturalios ir gražios;
Ram: 16Gb DDR4;
SSD: 256Gb NVme greitas diskas;
Klaviatūra: yra skaičių sekcija - pilna klaviatūra;
Windows 11 Pro su licenzija; 
MS Office - Word, Power Point, Excel;
Jungtys matosi nuotraukose.

Kompiuteri galima iskart naudoti savoms reikmems, darbams ar mokslams, yra visos reikalingos programos. 

Visi papildomi klausimai telefonu ir žinute. Yra kompiuteris, yra skelbimas. Būnu Vilniuje ir Šiauliuose bei Kaune. 

Galiu siųsti išperkamuoju paštu ar paštomatu.

